    false,nt"url": null,nt"notes": "A muskox survey was conducted on Nunivak
    Island Aug. 21-22 by Lee Hotchkiss and Mike Smith. This year we digressed from the
    usual method of attempting to make a complete head count, and instead got a representative
    sample with which to estimate the total population and production. 66 herds or individuals
    were sighted for a total of 406 muskox of which 79 or 19.5% were calves. Assuming
    the same proportion of calves to adult in the animals missed as those counted, a
    population of 675 musk ox including 110 calves is estimated for summer 1980.",nt"license_title":
